import { AccWrapper, AccContainer } from "./AccElements";

const Account = () => {
  return (
    <>
      <AccWrapper>
        <AccContainer>
          <AccBar></AccBar>
          <AccInfo></AccInfo>
        </AccContainer>
      </AccWrapper>
    </>
  );
};

export default Account;
